  \"2015-05-07T02:19:07.637878\",\n\t\"name\": \"gozcards-source-data-for-hydrogen-chloride-monthly-zonal-means-on-a-geodetic-latitude-and-\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The GOZCARDS Source Data for Hydrogen Chloride
  Monthly Zonal Averages on a Geodetic Latitude and Pressure Grid product (GozSmlpHCl)
  contains zonal means and related information (standard deviation, minimum/maximum
  value, etc.), calculated from original (u2018Level 2u2019 type) satellite instruments
  and products. The source HCl data are from the following satellite instruments:
  HALOE (v19; 1991 - 2005), ACE-FTS (v2.2u; 2004 - onward), and Aura MLS (v3.3; 2004
  - onward). The vertical pressure range for HCl is from 147 to 0.5 hPa. The source
  data are used to create a merged product contained in a separate data product with
  the short name GozMmlpHCl.nnThe GozSmlpHCl source data are written using the new
  netCDF4 enhanced model using CF-1 metadata attributes. The data variables are organized
  into a Group hierarchy structure. Global Attributes describing the data file (e.g.
  data start/end time, spatial extent, etc.) are located at the file/root level. Users
  can use netCDF enabled tools to view the data. Since netCDF4 is based on the HDF5
  format, HDF5 readers will also work with these data files.nnParameters contained
  in the data files include the following:nVariable Name    |Description                                  |Unitsn/HALOE/average
  \  |Hydrogen Chloride Zonal Average from HALOE   |(mol/mol)n/ACE-FTS/average |Hydrogen
  Chloride Zonal Average from ACE-FTS |(mol/mol)n/Aura MLS/average|Hydrogen Chloride
  Zonal Average from Aura MLS|(mol/mol)nEnd of parameter informationGOZCARDS (Global
  OZone Chemistry And Related trace gas Data records for the Stratosphere) refers
  to a commonly-formatted Earth system data record (ESDR) for stratospheric composition,
  of high relevance to the issue of ozone decline and recovery. High-quality long-term
  ozone and related trace gas data records are needed to (a) evaluate and understand
  composition changes in the atmosphere and (b) constrain model representations of
  atmospheric dynamics and photochemistry.\",\n\t\"license_title\": \"U.S. Government
